import React from 'react';
import '../styles/App.css';
import LeafletMap from './LeafletMap';
import RouterList from './RouterList';

function App() {

  const bodyStyle = {
    display: 'flex',
    flexDirection: 'row',
    width: '100vw',
    height: '90vh',
  };


  return (
    <div className="App">
      <header className="App-header">
      </header>
      <div style={bodyStyle}>
        <RouterList/>
       <LeafletMap/>
      </div>
    </div>
  );
}

export default App;
